<style lang="scss">

.scale {
  height: 500px;
  position: relative;
  margin: auto;
  display: block;
}

svg {
  position: absolute;
 height: 100%;
 width: 100%;
 left: 0;
 top: 0;
}

.link {
  cursor: pointer;
  &:hover {
    .text path {
      fill: #BE1E2D;
    }
  }
}

#Invert {
  -webkit-animation: handInversion 10s infinite; /* Safari 4+ */
  -moz-animation:    handInversion 10s infinite; /* Fx 5+ */
  -o-animation:      handInversion 10s infinite; /* Opera 12+ */
  animation:         handInversion 10s infinite;
}

@-webkit-keyframes handInversion {
  0%   { opacity: 0; }
  40%   { opacity: 0; }
  50%  { opacity: 1; }
  90%   { opacity: 1; }
  100% { opacity: 0; }
}
@-moz-keyframes handInversion {
  0%   { opacity: 0; }
  50%   { opacity: 0; }
  40%  { opacity: 1; }
  90%   { opacity: 1; }
  100% { opacity: 0; }
}
@-o-keyframes handInversion {
  0%   { opacity: 0; }
  40%   { opacity: 0; }
  50%  { opacity: 1; }
  90%   { opacity: 1; }
  100% { opacity: 0; }
}
@keyframes handInversion {
  0%   { opacity: 0; }
  40%   { opacity: 0; }
  50%  { opacity: 1; }
  90%   { opacity: 1; }
  100% { opacity: 0; }
}

</style>

<script>
export default {
  methods: {
    makeLinks: function () {
      const hand = this.$el
      const handlinks = hand.querySelectorAll('.link')
      for (let i = 0; i < handlinks.length; i++) {
        let link = handlinks[i]
        let url = link.getAttribute('data-url')
        link.addEventListener('click', function () {
          window.location.href = url
        })
      }
    }
  },
  mounted () {
    this.makeLinks()
  }
}
</script>
